            <h3>Avoid Close Contact</h3>
            <p>COVID-19 spreads mainly among people who are in close contact (within 6 feet) for a period. Spread happens when an infected person sneezes, or talks, droplets from their mouth are launched into the air and land in the mouths or noses of people nearby.</p>
            <a href="https://www.cdc.gov/coronavirus/2019-ncov/prevent-getting-sick/prevention.html#:~:text=Stay%206%20feet%20away%20from,sick%20and%20other%20household%20members." class="btn">learn more</a>
        </div>

    </div>

