            <h1 class="heading">things <span>to do</span> during covid</h1>
            <p>The world is pretty topsy-turvy right now, because of the global panic around coronavirus (COVID-19). If youre feeling overwhelmed or stressed by it all, be reassured that this is a very normal response. However, its important to go easy on yourself and to take time for self-care.</p>
            <ul>
                <li>Wash Your Hands For 20 sec</li>
                <li>Maintain Social-Distancing</li>
                <li>Wear a Mask</li>
                <li>Seek Medical Care Regularly</li>
                <li>Avoid crowds and poorly ventilated indoor spaces.</li>
                <li>Clean high touch surfaces daily.</li>
            </ul>
        </div>

